import React from 'react';
import Navbar from './components/Navbar'
import Button from './components/Button'
import { BrowserRouter as Router, Routes, Route} from 'react-router-dom';
import './App.css';

function App() {
  return (
    <>
      <Router>
        <Navbar/>
        <Button/>
        <Routes>
          <Route path='/' exact/>
        </Routes>

      </Router>
      <h1>Hi b </h1>


    </>
  );
}

export default App;
